import React from 'react';
import Home from './home';
import Head from 'next/head';
const App = () => (
    <div>
        <Head>
        <link rel="stylesheet" href="https://cdn.jsdelivr.net/npm/uikit@3.4.6/dist/css/uikit.min.css" />
        </Head>
        <Home/>
    </div>
);
export default App;
